function viewPic(img){ 
    img1= new Image(); 
    var imgsrc = ""+img.src;
    img1.src=(imgsrc);
    call(imgsrc); 
} 
function call(img){ 
    if((img1.width!=0)&&(img1.height!=0)){ 
        viewImg(img); 
    }else{ 
        funzione="call('"+img+"')"; 
        intervallo=setTimeout(funzione,20); 
    } 
} 
function viewImg(img){ 
    WinW=img1.width+20; 
